import React from 'react'
import {Link} from 'react-router-dom'

const Header = () => {
  return (
    <div className='main-div'>
      <Link className='link' to='/'><h3>Movie Database</h3></Link>  
      <h5>Api from omdbapi.com</h5>   
    </div>
  )
}

export default Header
